import React from 'react'
import { LoadScript, GoogleMap, Marker } from '@react-google-maps/api';
export default function Testmap({totalLine}) {
    //console.log(totalLine);

    const center = {
        lat : 37.666169,
        lng  : 128.710769
    };
    return (
        <div>
            <LoadScript googleMapsApiKey="AIzaSyDevvetng60XedeOqk-qW9TF-XBNQsyxdE">
                <GoogleMap
                    mapContainerStyle={{
                        width : '1900px',
                        height : '500px',
                        margin : '20px'
                    }}
                    center={center}
                    zoom={13}
                >
                    {
                        totalLine.map((value)=>{
                            console.log(value);
                            return(
                                <Marker 
                                    position={value}
                                />
                            );
                        })
                    }
                </GoogleMap>
            </LoadScript>
        </div>
    )
}
